import logo from './pecking_animation.gif';
import './App.css';

import React from 'react';
import {Routes, Route, NavLink, BrowserRouter} from 'react-router-dom';

import Feed from './pages/feed';
import NewPost from './pages/newPost';
import PostSuccessful from './pages/postSuccessful';
import PostToAFriend from './pages/postToAFriend';
import PostToAFriendSuccessful from './pages/postToAFriendSuccessful';
import Messages from './pages/messages';
import CalendarArchive from './pages/calendarArchive';
import AddAFriend from './pages/addAFriend';
import Notifications from './pages/notifications';
import Settings from './pages/settings';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>3 LITTLE BIRBS</h1>
        <h6>
          Under Construction.
        </h6>

      </header>

      <BrowserRouter>
        <div>
          <nav>
            <ul>
            <li><NavLink to="/feed">Feed</NavLink></li>
            <li><NavLink to="/newpost">New Post</NavLink></li>
            <li><NavLink to="/postsuccessful">Post Successful</NavLink></li>
            <li><NavLink to="/posttoafriend">Post To A Friend</NavLink></li>
            <li><NavLink to="/posttoafriendsuccessful">Post To A Friend Successful</NavLink></li>
            <li><NavLink to="/messages">Messages</NavLink></li>
            <li><NavLink to="/calendararchive">Calendar Archive</NavLink></li>
            <li><NavLink to="/addafriend">Add A Friend</NavLink></li>
            <li><NavLink to="/notifications">Notifications</NavLink></li>
            <li><NavLink to="/settings">Settings</NavLink></li>
            </ul>
          </nav>
          </div>

          <div className = "contentcontainer">
            <Routes>
            <Route path="/feed" element={<Feed />} />
            <Route path="/newpost" element={<NewPost />} />
            <Route path="/postsuccessful" element={<PostSuccessful />} />
            <Route path="/posttoafriend" element={<PostToAFriend />} />
            <Route path="/posttoafriendsuccessful" element={<PostToAFriendSuccessful />} />
            <Route path="/messages" element={<Messages />} />
            <Route path="/calendararchive" element={<CalendarArchive />} />
            <Route path="/addafriend" element={<AddAFriend />} />
            <Route path="/notifications" element={<Notifications />} />
            <Route path="/settings" element={<Settings />} />
            </Routes>
            </div>
        </BrowserRouter>


    </div>
  );
}

export default App;
